import { NavLink } from 'react-router-dom';

class Contact extends Component {
  render () {
    return (
      <div>
      <div className='navbar2'>
      <NavLink to="/contact" className="navButton"> Contact Us </NavLink>
      </div>



      </div>
    )
  }
}

export default Contact
